    public static int getTheASCIIvalue(string s)
    {
        int result = 0;
        for (int i = 0; i < s.Length; i++)
        {
            result += (int)s[i];
        }
        return result;
    }
    public static char FindTheDifference(string s, string t)
    {
        int Tasci = getTheASCIIvalue(t);
        int Sasci = getTheASCIIvalue(s);
        return (char)(Tasci - Sasci);

    }
    public static void Main()
    {
        Console.WriteLine(FindTheDifference("abcd", "abcde"));
        Console.WriteLine(FindTheDifference("", "y"));
        Console.WriteLine(FindTheDifference("test", "teest"));
        string s = "";
        string t = "";

        char result = FindTheDifference(s, t);
        Console.WriteLine(result);


